import React from 'react';
import logo from './logo.svg';
import './App.css';

class App extends React.Component {
  state = {countries: []}

  componentDidMount() {
    fetch(`/catalog`, { 'Accept': 'application/json'})
      .then (res => res.render())/*
      .then((countries) => this.setState({ countries}));
  */ }
  render () {
  return (
    <div className="App">
      <h1>
        Hello
      </h1>
      {this.state.countries.map((country, ind) =>
          <div key={ind}>{country.name}</div>
        )}
    </div>
  );}
}

export default App;
